import data from '../../static/csv/fplAnalytics-playerStautsData (6).csv';

function Recommender() {
    console.log(data);
    return (
        <h1 onClick={recommenderSearchButtonClicked}>Recommender page</h1>
    )
}

async function recommenderSearchButtonClicked() {
    const response = await fetch(data);
    const CSVdata = await response.text();
    console.log(CSVdata);
}

export default Recommender;
